import "./Steps.css";

    const Steps = ({currentStep}) => {
    return (
        <div className="steps">
            <div className="step">
                <AiOutlineUser />
            <h3>Identificação:</h3>
            </div>
            <div className="step">
                <AiOutlineStar />
            <h3>Avaliação:</h3>
            </div>
            <div className="step">
                <FiSend />
            <h3>Envio:</h3>
            </div>
        </div>
    )
}


export default Steps;
